import React from 'react';

const ListItem = () => (
    <li>
        <img 
            src={image}
            alt={name}
            className="ListItem__image"
        />
        <div className="ListItem__wrapper">
            <h2 className="ListItem__name"></h2>
            <p className="ListItem__description"></p>
            <a className="ListItem__button">Visit My Link</a>
        </div>
    </li>
)

export default ListItem;
